local Lib = LibStub:NewLibrary("ItemPrice-1.1", "$Revision: 79224 $")
if not Lib then return end

local _G = _G
local type, tonumber = type, tonumber
local match = string.match

local GetItemInfo = GetItemInfo

local price_count, get

function Lib:GetPriceById(itemId)
	return get(itemId)
end

function Lib:GetPrice(item)
	local t = type(item)
	if t == "number" then return get(item) end
	if t == "string" then return get(tonumber(item) or tonumber(match(item, "item:(%d+)"))) end
end

function Lib:GetPriceCount()
	return price_count
end

function Lib:GetSellValue(id)
	if type(id) ~= "number" and type(id) ~= "string" then return end

	if type(id) == "string" then
		if not id:find("item:") then
			local _
			_, id = GetItemInfo(id)

			if not id then return end
		end

		id = tonumber(id:match("item:(%d+)"))
	end

	return self:GetPriceById(id)
end

